css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 7px 21px;
  text-align: center;
  font-weight: 600;
  color: #808083;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #1c1c38;
  background-color: #080913;
}
.github-tab-icon {
  color: #3d3d44;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #202029;
  border-radius: 2px;
  padding: 0 .25em;
  margin-left: 7px;
}
.github-tab.react-tabs__tab--selected {
  color: #759deb;
  box-shadow: 0 1px 0 #2f3675;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #a8a8a8;
}
